Its very hard to compromise ethics in the modern schooling system, especially when your biggest booster wants you to pass his son despite his dismal grades. Its always the idealists that dont see the logic in doing whatever it takes to be the best school in the state and in this case Teacher J.Sins is the idealist and Principle Carrera is about to teach one fuck lesson that will make him see life in a whole new way.
